import React from 'react';
import LoginFrom from '../components/LoginForm';
import { Row, Col } from 'antd';

const Login = () => {
    return (
        <div style={{ display: 'block', backgroundColor: '#F3F5F7', height: '100vh', alignItems: 'center'}}>
            <Row>
                <Col xs={24} md={12} >
                </Col>
                <Col xs={24} md={12}>
                    <LoginFrom/>
                </Col>
                <Col xs={24} md={12} >
                </Col>
            </Row>

        </div>

    );
};


export default Login;
